import React from 'react';
import '../App.css';
import { useSelector } from 'react-redux';
const Bottom = () => {
  const number = useSelector((store) => store.number);

  return (
    <div className="sub_container">
      <h1>Bottom</h1>
      <button onClick={addNumber}>증가</button>
    </div>
  );
};

export default Bottom;
